import React from 'react';
import '../App.css';
import Form from "./Form";
import {useWeather} from "../Context/WeatherContext";
import Weather from "./Weather";

function Container() {
    return (
        <div>
            <Form/>
            <Weather/>
        </div>
    );
}

export default Container;
